import React from 'react';
import { Button } from 'reactstrap';
import './LearningListItem.scss';

const LearningListItem=({image})=>{
    return (
        <div className="lp-list-item ">
            <div className="lp-img-container">
                <img  className="lp-img" src={'https://i.ibb.co/s9rhPDB/van-dragt-061819-0174-mountaineering-gear.jpg'} />
            </div>
            <div className="lp-item-content ">
                <div className="lp-item-txt">
                     attempting to attain, high points in mountainous regions, mainly for the pleasure of the climb. Although the term is often loosely applied to walking up low mountains that offer only moderate difficulties, it is more properly restricted to climbing in localities where the terrain and weather conditions present such hazards that, for safety, a certain amount of previous experience will be found necessary. For the untrained, mountaineering is a dangerous pastime.
                </div>

                <div className="lp-item-btn">
                    <button>rrr</button>
                </div>
            </div>
        </div>
    );
}

export default LearningListItem;
